import React from "react";
import "./Publication.css";
function Publication() {
  return (
    <>
      <div className="">
        <h1>Professional Experience</h1>
        <div class="row">
          <div class="column">
            <h2>Column 1</h2>
            <p>Some text..</p>
          </div>
          <div class="column">
            <h2>Column 2</h2>
            <p>Some text..</p>
          </div>
        </div>
      </div>
    </>
  );
}

export default Publication;
